import './App.css';
import { SearchComponent } from './components/SearchComponent'
import data from './data/advisors_10000.csv'

function App() {
  console.log(data);
  return (
    <div className="App">
      <SearchComponent />
      {data.map(function (item) {
        return (
          <p>{item}</p>
        )
      })}
    </div>
  );
}

export default App;
